isscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",bxc='Dimension',bjc='Dimension [height=',rtc='DirectionalTextHelper',utc='DockLayoutPanel',vtc='DockLayoutPanel$Direction',wtc='DockLayoutPanel$Direction;',ztc='DockLayoutPanel$DockAnimateCommand',xtc='DockLayoutPanel$LayoutData',Epc='DomEvent',Jpc='DomEvent$Type',Lvc='Double',_fc='EAST',Iac='EEE, d MMM yyyy HH:mm:ss Z',Slc='EEE. dd MMM. yyyy HH:mm:ss',Ibc='EEEE MMMM d',hcc='EEEE, MMMM d',dcc='EEEE, MMMM d, y',Ebc='EEEE, y MMMM dd',j8b='EM',eec='EMPTY',jec='ENABLED',Bcc='END',l8b='EX',Zrc='ElementMapperImpl',$rc='ElementMapperImpl$FreeNode',ccc='English',Qoc='Enum',Vbc='Etc/GMT',Xbc='Etc/GMT+',Wbc='Etc/GMT-',D8b='Event type',Ruc='Event$NativePreviewEvent',Wpc='EventBus',eoc='EventObject',joc='Exception',Iec='Expecting version 6 from server, got ',z9b='F',_jc='F8834F07517EF3B7D02B9E845E5E1B88',e8b='FIXED',efc='FLOAT',Jjc='Fail: ',T9b='Feb',H9b='February',Mvc='Float',Atc='FlowPanel',_sc='FocusWidget',dic='For input string: "',vac='Fri',oac='Friday',R8b='GET',hmc='GGD55XLBAH',Nnc='G
